void casa_parenteses(char* array1, int* p) {
    int paren = 1;
      while (paren) {
        char c  = array1[(*p)++];
        if(c == '('){
            paren++;
        }else if(c == ')'){
            paren--;
        }
    }
}
void alocaFreeList() {
	freelist = mem;
	int i;
	Celula* pt = freelist;
	for(i = 1; i < HEAP; i++) {
		pt->type = '\0';
		pt->esq = NULL;
		pt->dir = NULL;
		pt->proximo = mem + i;
		pt = pt->proximo;
	}
}

Celula* alocaMemoria() {
	Celula* alocada = NULL;
	if(freelist->type != '\0') {
		freelist = freelist->proximo;
		alocada = freelist;
	}
	else {
		alocada = freelist;
		freelist = freelist->proximo;
	}

	return alocada;
}

Celula* aplicacao() {
	Celula* a = alocaMemoria();
	a->type = '@';
	a->dir = NULL;
	a->esq = NULL;

	return a;
}


Celula* combinador(char s) {
	Celula* a = alocaMemoria();
	a->type = codificar(s);
	a->dir = NULL;
	a->esq = NULL;

	return a;
}


char* retornaString(char* string, int fim) {
	char* s = (char*) malloc((fim+1)*sizeof(char*));
	int i;
	for(i = 0;i < fim; i++) {
		s[i] = string[i];
	}
	s[i] = '\0';

	return s;
}


Celula* geraGrafo(char* string) {
	Celula* subgrafo = aplicacao();
	while(string[0] != '\0') {
		if(string[0] == '(') {
			int p = 1;
			casa_parenteses(string, &p);
			if(subgrafo->dir != NULL) {
				Celula* novosubgrafo = aplicacao();
				novosubgrafo->esq = subgrafo;
				novosubgrafo->dir = geraGrafo(retornaString(&string[1],p-2));
				subgrafo = novosubgrafo;
			}
			else {
				subgrafo->dir = geraGrafo(retornaString(&string[1],p-2));
			}
			string+=p;
		}
		else if(subgrafo->esq == NULL) {
			subgrafo->esq = combinador(string[0]);
			string++;
		}
		else if(subgrafo->dir == NULL) {
			subgrafo->dir = combinador(string[0]);
			string++;
		}
		else {
			Celula* subgrafo_acima = aplicacao();
			subgrafo_acima->esq = subgrafo;
			subgrafo = subgrafo_acima;
		}
	}
	return subgrafo;
}


void pos_ordem(Celula* grafo) {
	if(grafo->esq != NULL)
		pos_ordem(grafo->esq);
	if(grafo->dir != NULL)
		pos_ordem(grafo->dir);
	printf("%c", grafo->type);
}


void push(Celula* c) {
	if(top < P){
		top++;
		stack[top] = c;
	}
}


void pop() {
	top--;
}


void aux_reduz(Celula* pai, Celula* apply) {
	if(pai == NULL){
		raiz = apply;
		push(raiz);
	}else{
		pai->esq = apply;
	}
}


void busca(Celula* grafo) {
	while(grafo != NULL) {
		push(grafo);
		grafo = grafo->esq;
	}
}


int codificar(char comb) {
	int res;
	switch(comb) {
		case '@':
			res = 0x0;
			break;
		case 'K':
			res = 0x1;
			break;
		case 'S':
			res = 0x2;
			break;
		case 'I':
			res = 0x3;
			break;
		case 'B':
			res = 0x4;
			break;
		case 'C':
			res = 0x5;
			break;
		case 'D':
			res = 0x6;
			break;
		case 'E':
			res = 0x7;
			break;
		case 'F':
			res = 0x8;
			break;
		case 'Y':
			res = 0x9;
			break;
		//Operadores aritmeticos
		case '+':
			res = 0xA;
			break;
		case '-':
			res = 0xB;
			break;
		case '*':
			res = 0xC;
			break;
		case '/':
			res = 0xD;
			break;
		// Combinadores lógicos
		case 'T'://TRUE
			res = 0xE;
			break;
		case 'A'://FALSE
			res = 0xF;
			break;
		case '>':
			res = 0x10;
			break;
		case '<':
			res = 0x11;
			break;
		case '='://Igualdade
			res = 0x12;
			break;
		case '&'://And logico
			res = 0x13;
			break;
		case '|'://Or logico
			res = 0x14;
			break;
		default:
			res = -1;
			break;
	}
	return res;
}


